 DROP TABLE IF EXISTS estantevirtual;
CREATE TABLE `estantevirtual` (
  `CODIGO` int(11) NOT NULL AUTO_INCREMENT,
  `COD_USUARIO` int(11) NOT NULL,
  `COD_LIVRO` int(11) NOT NULL,
  `STATUS` tinyint(4) NOT NULL DEFAULT '0' COMMENT '0:NAO_LIDO, 1:LIDO, 2:LENDO',
  `ESCOPO` tinyint(4) NOT NULL DEFAULT '1' COMMENT '1=DISPONIVEL, 0=INDISPONIVEL,2=TRANSICAO',
  `FOTO` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `OBS` varchar(200) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`CODIGO`),
  KEY `COD_USUARIO` (`COD_USUARIO`,`COD_LIVRO`)
) ENGINE=MyISAM AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ;

