  `ANO` varchar(4) COLLATE utf8_unicode_ci NOT NULL,
  `EDICAO` varchar(4) COLLATE utf8_unicode_ci NOT NULL,
  `PAGINAS` int(5) NOT NULL,
  `EDITORA` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `ISBN` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `FOTO` varchar(60) COLLATE utf8_unicode_ci NOT NULL DEFAULT 'semcapa.jpg',
  `DATA_CADASTRO` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`CODIGO`)
) ENGINE=MyISAM AUTO_INCREMENT=401 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ;

